import React from "react"

function TodoItem(props){
    console.log(props)
    return(
        
         <div className="App">
        <div className="todo">
        <input className="check" type="checkbox"/>
        <p className="text">{props.dothis}</p>
        </div>
        </div>
    )
}

export default TodoItem
